import React, { useEffect, useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import axios from "axios";
import "./AnnouncementEdit.css";
const AnnouncementEdit = () => {
  const { courseId, announcementId } = useParams();
  const navigate = useNavigate();

  /** ‚úÖ ÏÉÅÌÉú Î≥ÄÏàò */
  const [token, setToken] = useState("");
  const [memberId, setMemberId] = useState(null);
  const [role, setRole] = useState("");
  const [title, setTitle] = useState("");
  const [content, setContent] = useState("");

  /** ‚úÖ Î°úÏª¨ Ïä§ÌÜ†Î¶¨ÏßÄÏóêÏÑú ÌÜ†ÌÅ∞ Í∞ÄÏ†∏Ïò§Í∏∞ */
  useEffect(() => {
    const storedToken = localStorage.getItem("token");
    if (storedToken) {
      setToken(storedToken);
    }
  }, []);

  /** ‚úÖ ÏÇ¨Ïö©Ïûê Ï†ïÎ≥¥ Í∞ÄÏ†∏Ïò§Í∏∞ */
  useEffect(() => {
    if (!token) return;

    const fetchUserData = async () => {
      try {
        const response = await axios.get("http://localhost:8090/api/users/me", {
          headers: { Authorization: `Bearer ${token}` },
        });

        console.log("üü¢ ÏÇ¨Ïö©Ïûê Ï†ïÎ≥¥:", response.data);
        setMemberId(response.data.id);
        setRole(response.data.role);
      } catch (error) {
        console.error("‚ùå ÏÇ¨Ïö©Ïûê Ï†ïÎ≥¥ Ï°∞Ìöå Ïã§Ìå®:", error.response?.data || error);
      }
    };

    fetchUserData();
  }, [token]);

  /** ‚úÖ Í≥µÏßÄÏÇ¨Ìï≠ Îç∞Ïù¥ÌÑ∞ Î∂àÎü¨Ïò§Í∏∞ */
  useEffect(() => {
    if (!token) return; // ‚ùå memberId Ï≤¥ÌÅ¨ Ï†úÍ±∞

    const fetchAnnouncement = async () => {
      try {
        const response = await axios.get(
          `http://localhost:8090/api/courses/${courseId}/announcements/${announcementId}`,
          { headers: { Authorization: `Bearer ${token}` } }
        );

        console.log("üü¢ Î∂àÎü¨Ïò® Í≥µÏßÄÏÇ¨Ìï≠:", response.data);
        setTitle(response.data.title);
        setContent(response.data.content);
      } catch (error) {
        console.error("‚ùå Í≥µÏßÄÏÇ¨Ìï≠ Î∂àÎü¨Ïò§Í∏∞ Ïã§Ìå®:", error.response?.data || error);
      }
    };

    fetchAnnouncement();
  }, [courseId, announcementId, token]);

  /** ‚úÖ Í≥µÏßÄÏÇ¨Ìï≠ ÏàòÏ†ï ÏöîÏ≤≠ */
  const handleUpdate = async () => {
    console.log("üü¢ ÏóÖÎç∞Ïù¥Ìä∏ ÏöîÏ≤≠ - memberId:", memberId);
    console.log("üü¢ ÏóÖÎç∞Ïù¥Ìä∏ ÏöîÏ≤≠ - role:", role);

    if (!token || !memberId) {
      alert("‚ùå ÏÇ¨Ïö©Ïûê Ïù∏Ï¶ùÏù¥ ÌïÑÏöîÌï©ÎãàÎã§. Îã§Ïãú Î°úÍ∑∏Ïù∏Ìï¥Ï£ºÏÑ∏Ïöî.");
      return;
    }

    if (role !== "PROFESSOR" && role !== "ADMIN") {
      alert("‚ùå Í∂åÌïúÏù¥ ÏóÜÏäµÎãàÎã§.");
      return;
    }

    try {
      const requestBody = {
        memberId: memberId, // ‚úÖ ÌôïÏã§Ìûà Ìè¨Ìï®
        title,
        content,
      };

      await axios.put(
        `http://localhost:8090/api/courses/${courseId}/announcements/${announcementId}/edit`,
        requestBody,
        {
          headers: {
            Authorization: `Bearer ${token}`,
            "Content-Type": "application/json",
          },
        }
      );

      alert("‚úÖ Í≥µÏßÄÏÇ¨Ìï≠Ïù¥ ÏàòÏ†ïÎêòÏóàÏäµÎãàÎã§.");
      navigate(`/courses/${courseId}/announcements`);
    } catch (error) {
      console.error("‚ùå Í≥µÏßÄÏÇ¨Ìï≠ ÏàòÏ†ï Ïã§Ìå®:", error.response?.data || error);
      alert("‚ùå Í≥µÏßÄÏÇ¨Ìï≠ ÏàòÏ†ïÏóê Ïã§Ìå®ÌñàÏäµÎãàÎã§.");
    }
  };

  return (
    <div className="edit-container">
      <h2>üì¢ Í≥µÏßÄÏÇ¨Ìï≠ ÏàòÏ†ï</h2>
      <input value={title} onChange={(e) => setTitle(e.target.value)} placeholder="Ï†úÎ™©" />
      <textarea value={content} onChange={(e) => setContent(e.target.value)} placeholder="ÎÇ¥Ïö©"></textarea>
      <button onClick={handleUpdate} disabled={!memberId || !token || (role !== "PROFESSOR" && role !== "ADMIN")}>
        ÏàòÏ†ï ÏôÑÎ£å
      </button>
      <button onClick={() => navigate(-1)}>Ï∑®ÏÜå</button>
    </div>
  );
};

export default AnnouncementEdit;
